import { Injectable } from "@angular/core";
import { Post } from "./post.model";

@Injectable({ providedIn: 'root' })
export class PostService {
    listOfPosts : Post[] = [
        new Post(
          "Nature", 
          "Nature is a British weekly scientific journal founded and based in London, England.", 
          "https://images.unsplash.com/photo-1610878180933-123728745d22?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MXx8Y2FuYWRhJTIwbmF0dXJlfGVufDB8fDB8fA%3D%3D&w=1000&q=80",
          "test@test.com",
          new Date()
        ),
        new Post(
          "France", 
          "France is a country in Europe, capital is Paris", 
          "data:image/jpeg;base64,",
          "paris@test.com",
          new Date()
        ),
        new Post(
          "Germany", 
          "Germany is the biggest country in Europe, capital is Berlin.", 
          "data:image/jpeg;base64,",
          "berlin@test.com",
          new Date()
        ),
        new Post(
          "Denmark", 
          "Denmark is a small country, situated in the north of Europe, the capital of Denmark is Coppenhagen.", 
          "data:image/jpeg;base64,",
          "rosborg@test.com",
          new Date()
        ),
    ];

    getPosts(){
        return this.listOfPosts;
    }

    deletePosts(index: number){
        this.listOfPosts.slice(index, 1);
    }

    addPost(post: Post){
        this.listOfPosts.push(post);
    }

    updatePost(index: number, post: Post){
        this.listOfPosts[index] = post;
    }
}